import s from "./Components.module.css";
import { ThemeContext } from "../context/ThemeContext";
import { useContext } from "react";
import "../global.css";

export default function Skills() {
	const theme = useContext(ThemeContext);
	console.log(theme.theme);
	return (
		<div className="skilsContainer">
			<div className="skillsTitle">
				<h1>Skills</h1>
				<span className="skillsCustom1"></span>
			</div>
			<div className="skillsIcons">
				<div className="skillsIcon1"></div>
				<div className="skillsIcon2"></div>
				<div className="skillsIcon3"></div>
				<div className="skillsIcon4"></div>
				<div className="skillsIcon5"></div>
				<div className="skillsIcon6"></div>
			</div>
		</div>
	);
}
